import React from 'react';

function ResultsPage({ data, reset }) {
  const { images } = data;

  return (
    <div>
      <h2>Generated Ad Variations</h2>
      <div style={{ display: 'flex', gap: 20, flexWrap: 'wrap' }}>
        {images && images.length > 0 ? (
          images.map((imgUrl, index) => (
            <div key={index} style={{ flex: '1 0 30%', textAlign: 'center' }}>
              <img src={imgUrl} alt={`Ad variation ${index + 1}`} style={{ maxWidth: '100%' }} />
              <a href={imgUrl} download={`ad_variation_${index + 1}.png`} style={{ display: 'block', marginTop: 8 }}>
                Download
              </a>
            </div>
          ))
        ) : (
          <p>No images generated.</p>
        )}
      </div>
      <button onClick={reset} style={{ marginTop: 20, padding: 10, fontSize: 16 }}>
        Generate New Ads
      </button>
    </div>
  );
}

export default ResultsPage;
